import React from 'react';
import { useNavigate } from 'react-router-dom';

function MyComponent() {
  const navigate = useNavigate();

  const handleButtonClick = (data) => {
    navigate(`/products/${data}`); // Include data as a parameter
  };

  const addProduct = (data) => {
    navigate(`/addProducts/${data}`); // Include data as a parameter
  };
  

  return (
    <div>
      <button onClick={() => handleButtonClick('AV392AHNNg8TZf5IoOKg')}>
        Send Data to Target Screen
      </button>

      <button onClick={() => addProduct('AV392AHNNg8TZf5IoOKg')}>
       Add Product
      </button>
    </div>
  );
}

export default MyComponent;
